import React from "react";
import Card from "@material-ui/core/Card";
import CardContent from "@material-ui/core/CardContent";
class CardDefine extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      cardValue: this.props.cardValue
    };
  }
  render() {
    return (
      <div
      // style={{
      //   display: "flex",
      //   justifyContent: "center",
      //   alignItems: "center",
      //   height: "20vh"
      // }}
      >
        <Card style={{ width: 100, margin: theme.spacing.unit }}>
          <CardContent>
            <h1>{this.state.cardValue}</h1>
          </CardContent>
        </Card>
      </div>
    );
  }
}

export default CardDefine;
